        var content = $(""select[name=ChooseLiveForWhat]"").val();
        if (parseInt(content) == 1) // 1=course
        {
            
            $(""#forcourse"").show();
            $(""#forevent"").hide();
        }
        else if (parseInt(content) == 2) //2=event
        {
            $(""#forcourse"").hide();
            $(""#forevent"").show();

        }
      
        else {
            $(""#forcourse"").hide();
            $(""#forevent"").hide();
        }
    });

